import React, { useState } from 'react';
import axios from 'axios';

function UploadPage() {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async () => {
    if (!file) {
      alert('ÌååÏùºÏùÑ ÏÑ†ÌÉùÌï¥Ï£ºÏÑ∏Ïöî.');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);

    try {
      const res = await axios.post('http://localhost:5000/api/analysis', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      const parsed = res.data.parsed;
      console.log('‚úÖ Î∂ÑÏÑù Í≤∞Í≥º:', parsed);
      setResult(parsed);

      // üëâ ÏÇ¨Ïö©Ïûê IDÎäî localStorageÏóêÏÑú ÌÜ†ÌÅ∞ decodeÌïòÍ±∞ÎÇò Í∞ÄÏßúÎ°ú ÌÖåÏä§Ìä∏ ID ÏÇ¨Ïö©
      const userId = 'ÌÖåÏä§Ìä∏UserID123'; // Ïã§Ï†úÎ°úÎäî Î°úÍ∑∏Ïù∏Ìïú Ïú†Ï†Ä IDÎ•º ÏÇ¨Ïö©Ìï¥Ïïº Ìï®

      // ‚úÖ Î∂ÑÏÑù Í≤∞Í≥º Ï†ÄÏû• ÏöîÏ≤≠
      await axios.post('http://localhost:5000/api/analysis/save', {
        userId: userId,
        filename: file.name,
        result: parsed,
      });

      console.log('‚úÖ Í≤∞Í≥º Ï†ÄÏû• ÏôÑÎ£å');

    } catch (err) {
      console.error('‚ùå ÏóÖÎ°úÎìú Ïã§Ìå®:', err);
      alert('ÏóÖÎ°úÎìú Ïã§Ìå®');
    }
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>üìÅ CSV ÌååÏùº ÏóÖÎ°úÎìú</h2>
      <input type="file" accept=".csv" onChange={handleFileChange} />
      <button onClick={handleUpload} style={{ marginLeft: '1rem' }}>
        ÏóÖÎ°úÎìú Î∞è Ï†ÄÏû•
      </button>

      {result && (
        <div style={{ marginTop: '2rem' }}>
          <h3>üìä Î∂ÑÏÑù Í≤∞Í≥º</h3>
          <pre>{JSON.stringify(result.slice(0, 5), null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default UploadPage;
